import {HiBell} from "react-icons/hi";

const _styleHiBell = {
    iconHiBell:{
        width: '75px',
        height: '75px',
        borderRadius: '33px',
        color: 'red',
        cursor: 'pointer',
    },
    };
function PinHiBell() {
    return (

            <HiBell style={_styleHiBell.iconHiBell}/>

    )
}

export default PinHiBell;
